import React, { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';
import code from './practiceCode/code.js'

function App() {
  return (
    <div className='background' >
      <div>
        <BrowserRouter>
          <ul>
            <li><Route path='/'><li>About</li></Route></li>
            <li><a href="about.asp">Practice Code</a></li>
          </ul>
        </BrowserRouter>
      </div>
    </div>

  );
}

export default App;
